import React from 'react';
import './Menu.css';

const MenuNavigation = () => {
    return (
        <div className='menu__nav'>
            <div className='menu__logo'><img src="../../assets/logo.png" alt="steak house logo"/></div>
            <div class="nav"></div>

        </div>
    )
}

export default MenuNavigation;
